import React from "react";
import styled from "styled-components";
import "bootstrap/dist/css/bootstrap.min.css";
import "./style.css";
export const Div = styled.div`
  text-align: center;
  margin-top: 40px;

  @media screen and (max-width: 810px) {
    margin-top: 250px;
  }
`;

export const ConstCostEstimator = () => {
  return (
    <div
      className="border"
      style={{
        marginTop: 50,
        backgroundColor: "#F8F8F6",
        width: 450,
        borderRadius: 5,
      }}
    >
      <h4 style={{ marginTop: 15 }}>Construction Cost Estimator</h4>
      <div>
        <input type="radio" name="PlotOrArea" style={{ margin: 15 }} />
        <label>Plot Size</label>
        <input type="radio" name="PlotOrArea" style={{ margin: 15 }} />
        <label>Site Area</label>
        <br />
        <div
          className="row"
          style={{ justifyContent: "space-around", width: 200 }}
        >
          <p className="col">Area</p>
          <input style={{ width: 100, height: 30 }} className="col" />
          <p className="col">Sqft</p>
        </div>
      </div>
    </div>
  );
};
